import styled from 'styled-components';

const Navbar = styled.div`
    display: flex;
    width: 100%;
    height: 60px;

    li {
      padding: 0 20px;
    }
`;

const MenuListLeft = styled.ul`
    display: flex;
    list-style-type: none;
    padding-left: 0;
    font-size: 14px;
    font-weight: 500;
    color: ${darkgrey}
`;

const MenuListRight = styled.ul`
    display: flex;
    list-style-type: none;
    padding-left: 0;
`;

export default {
    MenuListLeft,
    MenuListRight,
    Navbar
}
